import React from "react";

class Pokemons extends React.Component {
    render(){
      const { value, measurementUnit} = this.pr.averageWeight
      return(
        <div className="card-pokemon">
          <p>{`name: ${this.name}`}</p>
          <p>{`type: ${this.type}`}</p>
          <p>{`averageWeight: ${value + measurementUnit}`}</p>
        </div>
      )
    }
}

export default Pokemons;
